  if (in->numPol>=1) row->gain1 = fRow + in->gain1Off;
  if (in->numPol>=1) row->sens1 = fRow + in->sens1Off;
  if (in->numPol>=2) row->type2 = iRow + in->type2Off;
  if (in->numPol>=2) row->nterm2 = iRow + in->nterm2Off;
  if (in->numPol>=2) row->x_typ2 = iRow + in->x_typ2Off;
  if (in->numPol>=2) row->y_typ2 = iRow + in->y_typ2Off;
