/**
 * Get table specific information from the infolist or descriptor
 * \param info Table to update
 * \param err  ObitErr for reporting errors.
 */
static void ObitTableIDI_GAIN_CURVEUpdate (ObitTableIDI_GAIN_CURVE *in, ObitErr *err)
{
  olong i;
  ObitInfoType type;
  gint32 dim[MAXINFOELEMDIM];
  ObitTableDesc *desc;
   union ObitInfoListEquiv InfoReal; 

 /* error checks */
   g_assert(ObitErrIsA(err));
  if (err->error) return;
  g_assert (ObitIsA(in, &myClassInfo));

  /* Get Keywords */
   /* tabrev */
  in->tabrev = 1; 
  ObitInfoListGetTest(in->myDesc->info, "TABREV", &type, dim, 
		       (gpointer)&in->tabrev);
   /* numPol */
  if (!ObitInfoListGet(in->myDesc->info, "NO_POL", &type, dim, 
		       (gpointer)&in->numPol, err)) return;
   /* no_stkd */
  in->no_stkd = 1; 
  ObitInfoListGetTest(in->myDesc->info, "NO_STKD", &type, dim, 
		       (gpointer)&in->no_stkd);
   /* stk_1 */
  in->stk_1 = -1; 
  ObitInfoListGetTest(in->myDesc->info, "STK_1", &type, dim, 
		       (gpointer)&in->stk_1);
   /* no_band */
  in->no_band = 1; 
  ObitInfoListGetTest(in->myDesc->info, "NO_BAND", &type, dim, 
		       (gpointer)&in->no_band);
   /* no_chan */
  in->no_chan = 1; 
  ObitInfoListGetTest(in->myDesc->info, "NO_CHAN", &type, dim, 
		       (gpointer)&in->no_chan);
  in->ref_freq = 1.0; 
  InfoReal.dbl = 1.0; 
  type = OBIT_double;
  ObitInfoListGetTest(in->myDesc->info, "REF_FREQ", &type, dim, 
		       (gpointer)&InfoReal);
  if (type==OBIT_double) in->ref_freq = InfoReal.dbl;
  if (type==OBIT_float)  in->ref_freq = InfoReal.flt;
  in->chan_bw = 1.0; 
  InfoReal.dbl = 1.0; 
  type = OBIT_double;
  ObitInfoListGetTest(in->myDesc->info, "CHAN_BW", &type, dim, 
		       (gpointer)&InfoReal);
  if (type==OBIT_double) in->chan_bw = InfoReal.dbl;
  if (type==OBIT_float)  in->chan_bw = InfoReal.flt;
   /* ref_pixl */
  in->ref_pixl = 1.0; 
  ObitInfoListGetTest(in->myDesc->info, "REF_PIXL", &type, dim, 
		       (gpointer)&in->ref_pixl);
   /* obscode */
  strncpy (in->obscode, "    ", MAXKEYCHARTABLEIDI_GAIN_CURVE); 
  ObitInfoListGetTest(in->myDesc->info, "OBSCODE", &type, dim, 
		       (gpointer)&in->obscode);
   /* ArrName */
  if (!ObitInfoListGet(in->myDesc->info, "ARRNAM", &type, dim, 
		       (gpointer)&in->ArrName, err)) return;
   /* RefDate */
  strncpy (in->RefDate, "YYYY-MM-DD", MAXKEYCHARTABLEIDI_GAIN_CURVE); 
  ObitInfoListGetTest(in->myDesc->info, "RDATE", &type, dim, 
		       (gpointer)&in->RefDate);
   /* numTabs */
  if (!ObitInfoListGet(in->myDesc->info, "NO_TABS", &type, dim, 
		       (gpointer)&in->numTabs, err)) return;

  /* initialize column numbers/offsets */
  in->antNoOff = -1;
  in->antNoCol = -1;
  in->ArrayOff = -1;
  in->ArrayCol = -1;
  in->fqidOff = -1;
  in->fqidCol = -1;
  in->type1Off = -1;
  in->type1Col = -1;
  in->nterm1Off = -1;
  in->nterm1Col = -1;
  in->x_typ1Off = -1;
  in->x_typ1Col = -1;
  in->y_typ1Off = -1;
  in->y_typ1Col = -1;
  in->x_val1Off = -1;
  in->x_val1Col = -1;
  in->y_val1Off = -1;
  in->y_val1Col = -1;
  in->gain1Off = -1;
  in->gain1Col = -1;
  in->sens1Off = -1;
  in->sens1Col = -1;
  in->type2Off = -1;
  in->type2Col = -1;
  in->nterm2Off = -1;
  in->nterm2Col = -1;
  in->x_typ2Off = -1;
  in->x_typ2Col = -1;
  in->y_typ2Off = -1;
  in->y_typ2Col = -1;
  in->x_val2Off = -1;
  in->x_val2Col = -1;
  in->y_val2Off = -1;
  in->y_val2Col = -1;
  in->gain2Off = -1;
  in->gain2Col = -1;
  in->sens2Off = -1;
  in->sens2Col = -1;
  /* Find columns and set offsets */
  desc = in->myDesc;
  if (desc->FieldName) {
    for (i=0; i<desc->nfield; i++) {
      if (!strncmp (desc->FieldName[i], "ANTENNA_NO", 10)) {
	 in->antNoOff = desc->offset[i];
 	 in->antNoCol = i;
      }
      if (!strncmp (desc->FieldName[i], "ARRAY", 5)) {
	 in->ArrayOff = desc->offset[i];
 	 in->ArrayCol = i;
      }
      if (!strncmp (desc->FieldName[i], "FREQID  ", 8)) {
	 in->fqidOff = desc->offset[i];
 	 in->fqidCol = i;
      }
      if (!strncmp (desc->FieldName[i], "TYPE_1", 6)) {
	     in->type1Off = desc->offset[i];
 	     in->type1Col = i;
      }
      if (!strncmp (desc->FieldName[i], "NTERM_1", 7)) {
	     in->nterm1Off = desc->offset[i];
 	     in->nterm1Col = i;
      }
      if (!strncmp (desc->FieldName[i], "X_TYP_1", 7)) {
	     in->x_typ1Off = desc->offset[i];
 	     in->x_typ1Col = i;
      }
      if (!strncmp (desc->FieldName[i], "Y_TYP_1", 7)) {
	     in->y_typ1Off = desc->offset[i];
 	     in->y_typ1Col = i;
      }
      if (!strncmp (desc->FieldName[i], "X_VAL_1", 7)) {
	     in->x_val1Off = desc->offset[i];
 	     in->x_val1Col = i;
      }
      if (!strncmp (desc->FieldName[i], "Y_VAL_1", 7)) {
	     in->y_val1Off = desc->offset[i];
 	     in->y_val1Col = i;
      }
      if (!strncmp (desc->FieldName[i], "GAIN_1", 6)) {
	     in->gain1Off = desc->offset[i];
 	     in->gain1Col = i;
      }
      if (!strncmp (desc->FieldName[i], "SENS_1", 6)) {
	     in->sens1Off = desc->offset[i];
 	     in->sens1Col = i;
      }
      if (!strncmp (desc->FieldName[i], "TYPE_2", 6)) {
	     in->type2Off = desc->offset[i];
 	     in->type2Col = i;
      }
      if (!strncmp (desc->FieldName[i], "NTERM_2", 7)) {
	     in->nterm2Off = desc->offset[i];
 	     in->nterm2Col = i;
      }
      if (!strncmp (desc->FieldName[i], "X_TYP_2", 7)) {
	     in->x_typ2Off = desc->offset[i];
 	     in->x_typ2Col = i;
      }
      if (!strncmp (desc->FieldName[i], "Y_TYP_2", 7)) {
	     in->y_typ2Off = desc->offset[i];
 	     in->y_typ2Col = i;
      }
      if (!strncmp (desc->FieldName[i], "X_VAL_2", 7)) {
	     in->x_val2Off = desc->offset[i];
 	     in->x_val2Col = i;
      }
      if (!strncmp (desc->FieldName[i], "Y_VAL_2", 7)) {
	     in->y_val2Off = desc->offset[i];
 	     in->y_val2Col = i;
      }
      if (!strncmp (desc->FieldName[i], "GAIN_2", 6)) {
	     in->gain2Off = desc->offset[i];
 	     in->gain2Col = i;
      }
      if (!strncmp (desc->FieldName[i], "SENS_2", 6)) {
	     in->sens2Off = desc->offset[i];
 	     in->sens2Col = i;
      }
     }
  }

  /* Check required columns */
  Obit_return_if_fail((in->antNoOff > -1), err,
       "ObitTableIDI_GAIN_CURVEUpdate: Could not find column antNo");
  Obit_return_if_fail((in->ArrayOff > -1), err,
       "ObitTableIDI_GAIN_CURVEUpdate: Could not find column Array");
  Obit_return_if_fail((in->fqidOff > -1), err,
       "ObitTableIDI_GAIN_CURVEUpdate: Could not find column fqid");
  if (in->numPol>=1) {
    Obit_return_if_fail((in->type1Off > -1), err,
       "ObitTableIDI_GAIN_CURVEUpdate: Could not find column type1");
    Obit_return_if_fail((in->nterm1Off > -1), err,
       "ObitTableIDI_GAIN_CURVEUpdate: Could not find column nterm1");
    Obit_return_if_fail((in->x_typ1Off > -1), err,
       "ObitTableIDI_GAIN_CURVEUpdate: Could not find column x_typ1");
    Obit_return_if_fail((in->y_typ1Off > -1), err,
       "ObitTableIDI_GAIN_CURVEUpdate: Could not find column y_typ1");
    Obit_return_if_fail((in->x_val1Off > -1), err,
       "ObitTableIDI_GAIN_CURVEUpdate: Could not find column x_val1");
    Obit_return_if_fail((in->y_val1Off > -1), err,
       "ObitTableIDI_GAIN_CURVEUpdate: Could not find column y_val1");
    Obit_return_if_fail((in->gain1Off > -1), err,
       "ObitTableIDI_GAIN_CURVEUpdate: Could not find column gain1");
  } /* end of if index in range */
  if (in->numPol>=2) {
    Obit_return_if_fail((in->type2Off > -1), err,
       "ObitTableIDI_GAIN_CURVEUpdate: Could not find column type2");
    Obit_return_if_fail((in->nterm2Off > -1), err,
       "ObitTableIDI_GAIN_CURVEUpdate: Could not find column nterm2");
    Obit_return_if_fail((in->x_typ2Off > -1), err,
       "ObitTableIDI_GAIN_CURVEUpdate: Could not find column x_typ2");
    Obit_return_if_fail((in->y_typ2Off > -1), err,
       "ObitTableIDI_GAIN_CURVEUpdate: Could not find column y_typ2");
    Obit_return_if_fail((in->x_val2Off > -1), err,
       "ObitTableIDI_GAIN_CURVEUpdate: Could not find column x_val2");
    Obit_return_if_fail((in->y_val2Off > -1), err,
       "ObitTableIDI_GAIN_CURVEUpdate: Could not find column y_val2");
    Obit_return_if_fail((in->gain2Off > -1), err,
       "ObitTableIDI_GAIN_CURVEUpdate: Could not find column gain2");
  } /* end of if index in range */
} /* end ObitTableIDI_GAIN_CURVEUpdate */

